window.bookSummaryJSON = "<p><b>Instant </b><b><i>New York Times</i></b><b> Best Seller </b><br> <b> Indie Best Seller</b></p> <p><b>In this stunning new fantasy novel from international best-selling author C. S. Pacat, heroes and villains of a long-forgotten war are reborn and begin to draw new battle lines. This epic fantasy with high-stakes romance will sit perfectly on shelves next to beloved fantasy novels like the Infernal Devices series, the Shadow and Bone trilogy, and the Red Queen series.</b></p> <p>Sixteen-year-old dock boy Will is on the run, pursued by the men who killed his mother. Then an old servant tells him of his destiny to fight beside the Stewards, who have sworn to protect humanity if the Dark King ever returns. Will is thrust into a world of magic, where he starts training for a vital role in the oncoming battle against the Dark.</p> <p>As London is threatened and old enmities are awakened, Will must stand with the last heroes of the Light to prevent the fate that destroyed their world from returning to destroy his own.</p> <p>Like V.E. Schwab’s <i>A Darker Shade of Magic</i> and Shelby Mahurin’s <i>Serpent &amp; Dove</i>, <i>Dark Rise</i> is more than just high intrigue fantasy - it’s fast-paced, action-packed, and completely surprising. Listeners will love exploring the rich setting of 19th-century London. This thrilling story of friendship, deception, loyalty, and betrayal is sure to find a passionate audience of listeners.</p>"; 
